import Link from 'next/link';

const UsersList = ()=>(
<div>
    <Link href="/User?name=Mehmet" as="Mehmet">
        <a className="username">Mehmet</a>
    </Link><br/>
    <Link href="/User?name=Ahmet" as="Ahmet">
        <a className="username">Ahmet</a>
    </Link>

<style jsx>{`
    .username{
        backround:black;
        color:white
    }
`}</style>
</div>
)
export default UsersList;
